import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar'
import Nav from 'react-bootstrap/Nav'
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
    <div style={{backgroundImage: 'https://w0.peakpx.com/wallpaper/889/274/HD-wallpaper-8-bit-minimalism-minimalism-artist-8-bit.jpg'}}>
    <Navbar bg="dark" variant="dark">
      <Container>
        <Navbar.Brand href="#home">Zenith</Navbar.Brand>
        <Nav className="me-auto">
          <Nav.Link href="#home">Home</Nav.Link>
          <Nav.Link href="#features">About Me</Nav.Link>
          <Nav.Link href="#pricing">Socials</Nav.Link>
        </Nav>
      </Container>
    </Navbar>
    </div>
  );
}

export default App;
